import React from "react";

import "./InvestmentForm.css";
import InvestmentInputGroup from "./InvestmentInputGroup";
import InvestmentInput from "./InvestmentInput";

function InvestmentForm(props) {
  return (
    <form className="form">
      <InvestmentInputGroup>
        <InvestmentInput id="current-savings" label="Current Savings ($)" />
        <InvestmentInput id="yearly-contribution" label="Yearly Savings ($)" />
      </InvestmentInputGroup>
      <InvestmentInputGroup>
        <InvestmentInput
          id="expected-return"
          label="Expected Interest (%, per year)"
        />
        <InvestmentInput id="duration" label="Investment Duration (years)" />
      </InvestmentInputGroup>
      <p className="actions">
        <button type="reset" className="buttonAlt">
          Reset
        </button>
        <button type="submit" className="button">
          Calculate
        </button>
      </p>
    </form>
  );
}

export default InvestmentForm;
